description:
Contains a SQLite3 database - icse-anon.db

MD5 (icse-anon.db) = b72dd5ad315910360771f951986115eb

Contains 3 tables with 448,021 records with the following schema:

CREATE TABLE schools ( id INTEGER PRIMARY KEY AUTOINCREMENT, school TEXT,school_id INTEGER );

CREATE TABLE subjects ( id INTEGER PRIMARY KEY AUTOINCREMENT, tla_code TEXT,board_code INTEGER,name TEXT,sub_group TEXT,notes TEXT );

CREATE TABLE anon_scores ( id INTEGER PRIMARY KEY AUTOINCREMENT, ds TEXT,anonymized_name TEXT,school TEXT,area TEXT,school_id TEXT,eng_top_four REAL,top_five REAL,ENG INTEGER,HCG INTEGER,MAT INTEGER,SCI INTEGER,ECO INTEGER,CST INTEGER,TDR INTEGER,CTS INTEGER,EVS INTEGER,AGS INTEGER,CTA INTEGER,EAS INTEGER,CAS INTEGER,ART INTEGER,IMH INTEGER,IMC INTEGER,WMS INTEGER,IND INTEGER,DMA INTEGER,HSC INTEGER,CKY INTEGER,FAD INTEGER,PED INTEGER,YOG INTEGER,TDA INTEGER,ENA INTEGER,HIN INTEGER,BEN INTEGER,PUN INTEGER,NEP INTEGER,GUJ INTEGER,MAR INTEGER,URD INTEGER,MIZ INTEGER,TIB INTEGER,ASM INTEGER,DZO INTEGER,POR INTEGER,ORI INTEGER,MAN INTEGER,TEL INTEGER,MAL INTEGER,TAM INTEGER,KAN INTEGER,TAN INTEGER,LEP INTEGER,KHA INTEGER,ANG INTEGER,GAR INTEGER,SAN INTEGER,ARB INTEGER,PER INTEGER,CHI INTEGER,FRE INTEGER,SPA INTEGER,RUS INTEGER,GER INTEGER,KOR INTEGER,DUT INTEGER,ARM INTEGER,JPN INTEGER,THA INTEGER,KIS INTEGER,BIN INTEGER,BMA INTEGER,ODE INTEGER,RTH INTEGER,RUP INTEGER,UTH INTEGER );


The three letter acronyms in the anon_scores can be joined with subjects to figure out the subject name. 

